use strict;
use warnings;
use List::MoreUtils qw(uniq);

# Get the four sets of three letters from command line arguments
die "Usage: ./letterboxed.pl set1 set2 set3 set4\n" unless @ARGV == 4;

my ($set1, $set2, $set3, $set4) = @ARGV;
# Turning our input into a regex is yet another recursive problem, heh.

# Split a word into an array, sort the array alphabetically, uniq it,
# then join that sorted array into a string and return it.
sub alphagram {
    my $word = shift;
    return join('', sort(uniq(split('', $word))))
}

my @future_regexp_parts = ();


for my $set ($set1, $set2, $set3, $set4) {
    die "Set is the wrong length: '$set'\n" unless length($set) == 3;
    my ($char1, $char2, $char3) = split //, $set;
    # we could do this recursively, but meh
    # gemini wrote: /r[$set1]|g[$set1]|h[$set1]|f[fso]|s[fso]|o[fso]|e[eui]|u[eui]|i[eui]|b[bnd]|n[bnd]|d[bnd]/;
    push(@future_regexp_parts, "${char1}[$set]|${char2}[$set]|${char3}[$set]");
}

my $future_regexp = join("|", @future_regexp_parts);

print "Regexp: '$future_regexp'\n";
#exit;
my $no_double_chars_regexp = qr/$future_regexp/;

my @dict = ();

open DICT, "</usr/share/dict/words" or die $!;
while (<DICT>) {
    next if /[A-Z]/; # no capital letters please
    chomp;
    #next if length($_) < 3; # Letterboxed does not accept one or two letter words
    #push(@dict, split / /);
    push(@dict, $_);
}

my @qualified_words = ();
my %word_scores;

foreach my $word (@dict) {
    chomp $word;
    # filter all words out that do not contain only our letters
    next unless $word =~ /^[($set1)($set2)($set3)($set4)]+$/;
    # filter words where the next letter is in the same group as the current letter
    next if $word =~ /$no_double_chars_regexp/;

    # TODO: for each word, we need to know the first and last letters
    # to match them to other words (assuming we don't have one word to
    # use all letters). We might want to match forwards and backwards
    # -- in other words, if we have a word of 10 letters, we might
    # find a /leading/ word for that instead of a /trailing/ word.
    push @qualified_words, $word;
    my $alphagram = alphagram($word);
    $word_scores{$word} = length($alphagram);

    # As chance would have it, this word pointed to bug.
    # if ($word eq 'pornographer') {
    # 	print "$word $alphagram\n";
    # 	exit;
    # }
}

foreach my $word (@qualified_words) {
    print "$word_scores{$word} $word\n";
}

=begin

Now, a simple solution is to just chain words together until we have a
solution such that:

- all the letters are used
- we have four or fewer words

because we already have only words that work for the puzzle. But the
better solution is to have two words that encompass all the letters.

We want two words, when combined, have an alphagram of 12 chars.

For each word:
  store it in a list based on the first letter
  same for a list based on last letter

We have to account for words that start and end with the same letter,
so probably best to build the data structures first before we proceed.
Divide and conquer.

=cut
